import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import Navbar from './componentes/elementos/Navbar.js';
import Titulo from './componentes/elementos/Titulo.js';

import Catalogo from './componentes/vistas/Catalogo.js';
import Contacto from './componentes/vistas/Contacto.js';
import Acerca from './componentes/vistas/Acerca.js';
import Login from './componentes/vistas/login.js';
 import { ChatBot } from 'react-chatbotify';

import ChatBotComponent from './componentes/elementos/ChatBotComponent.js'; // corregido nombre

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <Titulo />
          <Navbar />
        </header>

        <main>
          <Routes>
            <Route path="/" element={<div>Inicio</div>} />
            <Route path="/acerca" element={<Acerca />} />
            <Route path="/catalogo" element={<Catalogo />} />
            <Route path="/contacto" element={<Contacto />} />
            <Route path="/login" element={<Login />} />
          </Routes>


        </main>
        <ChatBotComponent />
      </div>
    </Router>
  );
}

export default App;
